import React from "react";

import styled from "styled-components";

interface IProps {
  title: String;
}

const StyledNavItem = styled.p`
    font-size: small;
    &:hover {
        color: blue;
    },
`;

const NavItem: React.FC<IProps> = ({ title }) => {
  return <StyledNavItem style={{ cursor: "pointer" }}>Hello</StyledNavItem>;
};

export default NavItem;
